(5, 'IELTS Preparatory Course', '', '<p><span style=\"font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Calibri&quot;,sans-serif;mso-ascii-theme-font:minor-latin;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;\r\nmso-ansi-language:EN-IN;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\">This is a one-month course for those individuals who are planning to pursue\r\ntheir goals of studying, working, or settling down permanently abroad. For\r\ncandidates whose level of English proficiency is below average, the training\r\nwith an additional fee may take a bit longer.&nbsp;\r\nIt also covers preparative lessons in PTE/TOEFL/ OET with a capping.&nbsp;</span><br></p>', '[]', '[]', 'english', 2, 1, '[]', '[]', 16000, NULL, 0, 'advanced', '1', NULL, '', 1716921000, NULL, 'general', 0, 1, 'active', '', '', '', NULL, 0, 0, 1, NULL, NULL, 0, '', 0, '2024-07-02 11:54:01', 0, ''),
