(7, 'Personality Development Program', '', '<p><span style=\"font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Calibri&quot;,sans-serif;mso-ascii-theme-font:minor-latin;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;\r\nmso-ansi-language:EN-IN;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\">This one-month course gives students a strong sense of self-assurance and\r\nconfidence, enabling them to carve out a niche for themselves and highlighting\r\nmultiple facets of personal growth.&nbsp;</span><br></p>', '[]', '[]', 'english', 3, 4, '[]', '[]', 16000, NULL, 0, 'beginner', '1', NULL, '', 1716921000, NULL, 'general', 0, 1, 'active', '', '', '', NULL, 0, 0, 1, NULL, NULL, 0, '', 0, '2024-07-02 11:54:01', 0, ''),
