INSERT INTO `frontend_settings` (`id`, `key`, `value`) VALUES
(1, 'banner_title', 'Master your English Communication Skills'),
(2, 'banner_sub_title', 'English Language Training Institute of international repute'),
(4, 'about_us', '<ol><li>Founded in 1993, British Lingua stands as an institution of\r\ninternational repute for its exceptional English communication skills training\r\nin India. It is registered under both the Trademark and Copyright Acts. The mission\r\nit has is to take the benefits of what English has to offer even to the lower\r\nstrata of Indian society wherein the underprivileged section cannot afford to\r\nattend formal English medium schools. In collaboration with public and private\r\ninstitutions, it has provided English language training to individuals, groups,\r\nand the general public with a successful track record for over three decades,\r\nshowcasing its enduring commitment and success.</li></ol><p class=\"MsoNormal\"><o:p><br></o:p></p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"></p><h3>The final Word<o:p></o:p></h3><p></p><p class=\"MsoNormal\">To sum up, let’s have an English proverb, ‘A smile is worth\r\na thousand words. Just in line with it, you’ll begin to wear a smile on your\r\nface once you belong to the British Lingua family.<o:p></o:p></p>');
