rsonal information about other Users without their consent;</li><li>Access or use the Application/Website/Services/products in any manner that could damage, disable, overburden or impair any of the Application’s/Website’s servers or the networks connected to any of the servers on which the Application/Website is hosted;</li><li>Intentionally or unintentionally interfere with or disrupt the Services or violate any applicable laws related to the access to or use of the Application/Website/Services/products, violate any requirements, procedures, policies or regulations of networks connected to the Application/Website/Services/products, or engage in any activity prohibited by these Terms;</li><li>Disrupt or interfere with the security of, or otherwise cause harm to, the Application/Website/Services/products, materials, systems resources, or gain unauthorized access to user accounts, passwords, servers or networks connected to or accessible through the Application/Website/Services/products or any affiliated or linked sites;</li><li>Interfere with, or inhibit any user from using and enjoying access to the Application/Website/ Services/products, or other affiliated sites, or engage in disruptive attacks such as the denial of service attack on the Application/Website/Services/products;</li><li>Use deep-links, page-scrape, robot, spider or other automatic device, program, algorithm or methodology, or any similar or equivalent manual process, to increase traffic to the Application/Website/Services/products, to access, acquire, copy or monitor any portion of the Application /Website/Services/products, or in any way reproduce or circumvent the navigational structure or presentation of the Application, or any content, to obtain or attempt to obtain any content, documents or information through any means not specifically made available through the Application/ Website/Services/products;</li><li>Alter or modify any part of the Services;</li><li>Use the Services for purposes that are not permitted by (i) these Terms; and (ii) any applicable law, regulation or generally accepted practices or guidelines in the relevant jurisdiction; or</li><li><div><span style=\"font-size: 10pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline; text-wrap: wrap;\"><span id=\"docs-internal-guid-1c4f79c0-7fff-effb-9244-43027e104b00\"><span style=\"font-size: 10pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline;\">Violate any of the terms specified under the Terms for the use of the Application/Website/Services/products. By submitting content on or through the Services (your “Material”), you grant us a worldwide, non-exclusive, royalty-free license (with the right to sublicense) to use, copy, reproduce, process, adapt, modify, publish, transmit, display and distribute such Material in any and all media or distribution methods (now known or later developed) and to associate your Material with you, except as described below. You agree that others may use Your Material in the same way as any other content available through the Services. Other users of the Services may fork, tweak and repurpose your Material in accordance with these Terms. If you delete your user account your Material and name may remain available through the Services.</span></span><br></span></div></li>\r\n</ol>\r\n</li>\r\n        </ol>\r\n</li><li style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify;\"><span lang=\"EN-US\" style=\"text-indent: -18pt; font-family: Calibri, sans-serif; font-size: 10pt; color: rgb(51, 51, 51);\"><span id=\"docs-internal-guid-6b8c168b-7fff-e672-cd14-dbc5991a1910\"><span style=\"font-size: 10pt; font-family: Arial, sans-serif; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline; white-space-collapse: preserve;\">In the preparation of the Application/Website/Services/products and contents therein, every effort has been made to offer the most current, correct, and clearly expressed information possible. Nevertheless, inadvertent errors may occur. In particular, but without limiting anything here, the Company disclaims any responsibility for any errors and accuracy of the information that may be contained in the Application. Any feedback from User is most welcome to make the Application and contents thereof error-free and user-friendly. The company also reserves the right and discretion to make any changes/corrections or </span></span></span>withdraw/add contents at any time without notice. Neither the Company nor any third parties provide any warranty or guarantee the accuracy, timeliness, performance, completeness or suitability of the information and materials found on Application/Website/Services/products. You acknowledge that such information and materials may contain inaccuracies or errors and we expressly exclude liability for any such inaccuracies or errors to the fullest extent permitted by law. Our Website provides Users with access to compiled educational information and related sources. Such information is provided on an as is basis and we assume no liability for the accuracy or completeness or use or non obsolescence of such information. We shall not be liable to update or ensure continuity of such information contained on the Website. We would not be responsible for any errors, which might appear in such information, which is compiled from third party sources or for any unavailability of such information. From time to time the Website may also include links to other websites. These links are provided for your convenience to provide further information. They do not signify that we endorse the website(s). We have no responsibility for the content of the linked website(s). You may not create a link to the Website from another website or document without the Company’s prior written consent.</li><li style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify;\"><span id=\"docs-internal-guid-4cf368e8-7fff-7dce-83ea-24ac5c58f860\"><p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 12pt; margin-bottom: 12pt;\"><span style=\"font-size: 10pt; font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline; white-space-collapse: preserve;\">Certain contents in the Application/Services/Website/products (in particular relating to assistance in preparations for administrative services) may contain opinions and views. The Company shall not be responsible for such opinions or any claims resulting from them. Further, the Company makes no warranties or representations whatsoever regarding the quality, content, completeness, or adequacy of such information and data.</span></p></span></li><li style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify;\"><div><span id=\"docs-internal-guid-e4ea2cf4-7fff-80e5-63dc-97496ef70568\"><p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 12pt; margin-bottom: 12pt;\"><span style=\"font-size: 10pt; font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline; white-space-collapse: preserve;\">Some parts of the Services are interactive. We encourage contributions by users, which may or may not be subject to editorial control before being posted. The Company accepts no responsibility or liability for any material communicated by third parties or users in this way. The Company reserves the right to remove, review, edit or delete any such content. Similarly, we will not be responsible or liable for any content uploaded by Users directly on the Website.</span></p></span></div></li><li style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify;\"><div><span style=\"font-size: 10pt; font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline; white-space-collapse: preserve;\"><span id=\"docs-internal-guid-9d259804-7fff-acca-bdff-5262fb7f593f\"><p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 12pt; margin-bottom: 12pt;\"><span style=\"font-size: 11pt; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline;\">The</span><span style=\"font-size: 10pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline;\"> Company may, based on any form of access to the Application (including free download/trials) or Services or Website or registrations through any source whatsoever, contact the User through SMS, email, WhatsApp and call, to give information about its products as well as notifications on various important updates and/or to seek permission for demonstration of its products. The User expressly grants such permission to contact him/her through telephone, SMS, e-mail, WhatsApp and holds the Company indemnified against any liabilities including financial penalties, damages, expenses in case the User’s mobile number is registered with Do not Call (DNC) database. By registering yourself, you agree to make your contact details available to our employees, associates, and partners so that you may be contacted for educational information and promotions.</span></p></span></span></div></li><li style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify;\"><div><span style=\"font-size: 10pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline;\"><span id=\"docs-internal-guid-ea31c89e-7fff-c8b6-8310-2f56f75997bc\"><p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 12pt; margin-bottom: 12pt;\"><span style=\"font-size: 10pt; font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline; white-space-collapse: preserve;\">Upon registration through any means whatsoever, the Company may contact You through the registered mobile number or e-mail or any other mobile number or contact number or email provided by You to enable effective provision of Services. The User expressly permits the Company to contact him/her and the student utilizing the Services, through the above-mentioned means at any time post-registration. Further, the Company shall have the right to monitor the download and usage of the Application/Services/products and the contents thereof by the Users, to analyze such usage and discuss the same with the Users to enable effective and efficient usage of the Services. The User expressly permits the Company to clear the doubts of the student using the Application/Services/Online portal by answering the questions placed before it, providing study plans, informing of the progress, providing feedback, communicating with the student and mentoring the student through telephone or e-mail on express consent of the legal guardian/parent of the User or through any other forum.</span></p></span></span></div></li><li style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify;\"><div><span style=\"font-size: 10pt; font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline; white-space-collapse: preserve;\"><span id=\"docs-internal-guid-6b3b654c-7fff-e93e-4d93-6982a9cf8e06\"><p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 12pt; margin-bottom: 12pt;\"><span style=\"font-size: 10pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline;\">While the Company has made efforts to train the personnel engaged in the sales and services relating to its products to enable quality control, it makes no warranties or representations whatsoever regarding the quality and competence of such personnel and would not be responsible for any deviant behavior of any such personnel. Any feedback from User relating to the same is most welcome and Company reserves the right and discretion to take any action in this regard.</span></p></span></span></div></li><li style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify;\"><div><span style=\"font-size: 10pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline;\"><span id=\"docs-internal-guid-4cc962c5-7fff-ffb1-bd9b-9050cfb3d683\"><p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 12pt; margin-bottom: 12pt;\"><span style=\"font-size: 10pt; font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline; white-space-collapse: preserve;\"> Access to certain elements of the Services including, doubt clearance, mentoring services, etc may be subject to separate terms, conditions and fair usage policy. The Company reserves the right to determine the criteria for the provision of various elements of Services to the different categories of Users based on its policies. Hence, subscription to the Application/products or registrations do not automatically entitle the User to any and all elements of Services provided by the Company and the Company shall be entitled to exercise its discretion while providing access to and determining the continuity of certain elements of Services. We reserve the right to extend, cancel, discontinue, prematurely withdraw or modify any of Our Services at Our discretion.</span></p></span></span></div></li><li style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify;\"><div><span style=\"font-size: 10pt; font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline; white-space-collapse: preserve;\"><span id=\"docs-internal-guid-61afdf8a-7fff-16b4-0cee-531f1c6f0a54\"><p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 12pt; margin-bottom: 12pt;\"><span style=\"font-size: 10pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline;\">The company conducts competitions from time to time and you agree to allow the company to use your submissions including but not limited to videos, written content, craftwork, etc for promotional purposes. All rights will be reserved by the company for usage of such submissions by you.</span></p></span></span></div></li><li style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify;\"><div><span style=\"font-size: 10pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline;\"><span id=\"docs-internal-guid-90aff92b-7fff-3002-ad52-d0b9324187b2\"><p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 12pt; margin-bottom: 12pt;\"><span style=\"font-size: 10pt; font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline; white-space-collapse: preserve;\">The Company’s products and/or Services, including the Application and content, are compatible only with certain devices/tablets/instruments/hardware. The Company shall not be obligated to provide workable products and/or services for any instruments that are not recognized by the Company or those instruments that may be purchased from any third party which are not compatible with the Company’s products and Services. The company reserves the right to upgrade the types of compatible devices as required from time to time.</span></p></span></span></div></li><li style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify;\"><div><span style=\"font-size: 10pt; font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline; white-space-collapse: preserve;\"><span id=\"docs-internal-guid-ec8a0485-7fff-7e4c-47b6-c84bff288b75\"><p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 12pt; margin-bottom: 12pt;\"><span style=\"font-size: 10pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline;\">The Company shall have no responsibility for any loss or damage caused to tablet or any other hardware and/or software and/or instrument, including loss of data or effect on the processing speed, resulting from Your use of our products and Services</span><span style=\"font-size: 14pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" background-color:=\"\" transparent;=\"\" font-variant-numeric:=\"\" normal;=\"\" font-variant-east-asian:=\"\" font-variant-alternates:=\"\" font-variant-position:=\"\" vertical-align:=\"\" baseline;\"=\"\">.</span></p></span></span></div></li><li style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify;\"><div><span style=\"font-size: 14pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" background-color:=\"\" transparent;=\"\" font-variant-numeric:=\"\" normal;=\"\" font-variant-east-asian:=\"\" font-variant-alternates:=\"\" font-variant-position:=\"\" vertical-align:=\"\" baseline;\"=\"\"><span id=\"docs-internal-guid-116e7cba-7fff-ac43-f5db-0554aa3c4152\"><p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 12pt; margin-bottom: 12pt;\"><span style=\"font-size: 10pt; font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline; white-space-collapse: preserve;\">You have to specify the address to which the shipment has to be made at the time of purchase. All product(s) shall be delivered directly to the address as specified at the point of ordering and you cannot, under any circumstances whatsoever, change the address after the order is processed. In case of any change in the address, you need to specify the same to us in writing well in advance to the shipping date. Any inconsistencies in name or address will result in non-delivery of the product(s).</span></p></span></span></div></li><li style=\"margin: 0cm 0cm 0cm 18pt; text-align: justify;\"><div><span style=\"font-size: 10pt; font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline; white-space-collapse: preserve;\"><span id=\"docs-internal-guid-59b972e0-7fff-803c-306b-da6e95291be4\"><p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 12pt; margin-bottom: 12pt;\"><span style=\"font-size: 10pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-variant-position: normal; vertical-align: baseline;\">Return Policy:</span></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;background-color:#ffffff;margin-top:12pt;margin-bottom:0pt;padding:0pt 0pt 12pt 0pt;\"><span style=\"font-size:10pt;font-family:Arial,sans-serif;color:#333333;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">(a) For return of product(s) damaged at the time of delivery, the shipping charges shall be borne by the Company. However, for return any of the product(s) for any other reason, it shall be the responsibility of the User to arrange for the return of such cancelled product(s) and the shipping charges shall be borne by such User.</span></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;padding:0pt 0pt 12pt 0pt;\"><span style=\"font-size:10pt;font-family:Arial,sans-serif;color:#333333;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">(b)We request you not to accept any product package that seems to be tampered with, opened or damaged at the time of delivery. The products must be returned in the same condition as delivered by the Company. Any products returned, showing signs of any use or damage in any manner shall not be accepted for return.</span></p><p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 12pt; margin-bottom: 12pt;\"><