(11, 'privacy_policy', 'BRITISH LINGUA values your trust and privacy and adheres to ethical standards in gathering, using and safeguarding any information that you provide.<o:p></o:p><p></p><span style=\"font-family: Nunito;\"></span><p class=\"MsoNormal\" style=\"margin-bottom: 8.3pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span lang=\"EN-US\" times=\"\" new=\"\" roman\";=\"\" mso-bidi-font-family:\"times=\"\" roman\";color:#333333\"=\"\" style=\"font-size: 10pt;\"><span style=\"font-family: Nunito;\">Lingua Multiservices Pvt Ltd (owner of the brand name BRITISH LINGUA), is an Edutech company incorporated in India for imparting education, skills and providing services. The company will be hereafter referred to as BRITISH LINGUA for the sake of brevity of understanding.</span><o:p></o:p></span></p><span style=\"font-family: Nunito;\"></span><p class=\"MsoNormal\" style=\"margin-bottom: 8.3pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span lang=\"EN-US\" times=\"\" new=\"\" roman\";=\"\" mso-bidi-font-family:\"times=\"\" roman\";color:#333333\"=\"\" style=\"font-size: 10pt;\"><span style=\"font-family: Nunito;\">This privacy policy governs the use of the applications, websites, other associated applications, products and services managed by the Company, LIngua Multiservices Pvt Ltd.</span><o:p></o:p></span></p><span style=\"font-family: Nunito;\"></span><p class=\"MsoNormal\" style=\"margin-bottom: 8.3pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: no