pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span lang=\"EN-US\" times=\"\" new=\"\" roman\";=\"\" mso-bidi-font-family:\"times=\"\" roman\";color:#333333\"=\"\" style=\"font-size: 10pt;\"><span style=\"font-family: Nunito;\">British Lingua may present links in a format that enables us to track if these links are followed or not. We use this information to improve personalized content. Clicking on links may take you to sites outside our domain. We are not responsible for the privacy practices of those websites. we encourage our users to be aware while being redirected to other sites, to read the EULA/T&amp;Cs of each website that collects personal information. This Privacy Policy applies solely to information collected by the Company\'s Website.&nbsp;</span><o:p></o:p></span></p><span style=\"font-family: Nunito;\"></span><p class=\"MsoNormal\" style=\"margin: 8.3pt 0cm; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span lang=\"EN-US\" times=\"\" new=\"\" roman\";=\"\" mso-bidi-font-family:\"times=\"\" roman\";color:#333333\"=\"\" style=\"font-size: 10pt;\"><span style=\"font-family: Nunito;\">Alerts</span><o:p></o:p></span></p><span style=\"font-family: Nunito;\"></span><p class=\"MsoNormal\" style=\"margin-bottom: 8.3pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span lang=\"EN-US\" times=\"\" new=\"\" roman\";=\"\" mso-bidi-font-family:\"times=\"\" roman\";color:#333333\"=\"\" style=\"font-size: 10pt;\"><span style=\"font-family: Nunito;\">