 All such sharing of information is done at your own risk. Please keep in mind that if you disclose personal information in your profile or when posting on its forums this information may become publicly available.&nbsp;</span><o:p></o:p></span></p><span style=\"font-family: Nunito;\"></span><p class=\"MsoNormal\" style=\"margin: 8.3pt 0cm; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span lang=\"EN-US\" times=\"\" new=\"\" roman\";=\"\" mso-bidi-font-family:\"times=\"\" roman\";color:#333333\"=\"\" style=\"font-size: 10pt;\"><span style=\"font-family: Nunito;\">Security</span><o:p></o:p></span></p><span style=\"font-family: Nunito;\"></span><p class=\"MsoNormal\" style=\"margin-bottom: 8.3pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span lang=\"EN-US\" times=\"\" new=\"\" roman\";=\"\" mso-bidi-font-family:\"times=\"\" roman\";color:#333333\"=\"\" style=\"font-size: 10pt;\"><span style=\"font-family: Nunito;\">British Lingua is committed to safeguarding your information. We provide physical, electronic and procedural safeguards to protect Information we process and maintain. We limit the access to this information to authorized employees only who need it for operating, developing or improving our Application/Services/products/Website. Please be aware that although we endeavour to provide stringent security, no security system can prevent all potential security breaches.&nbsp;</span><o:p></o:p></span></p><span style=\"font-family: Nunito;\"></span><p class=\"MsoNormal\" style=\"margin: 8.3pt 0cm; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span lang=\"EN-US\" style=\"font-size: 10pt; color: rgb(51, 51, 51); font-family: Nunito;\">&nbsp;</span></p><span style=\"font-family: Nunito;\"></span><p class=\"MsoNormal\" style=\"margin: 8.3pt 0cm; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span lang=\"EN-US\" style=\"font-size: 10pt; color: rgb(51, 51, 51); font-family: Nunito;\">&nbsp;</span></p><span style=\"font-family: Nunito;\"></span><p class=\"MsoNormal\" style=\"margin: 8.3pt 0cm; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span lang=\"EN-US\" times=\"\" new=\"\" roman\";=\"\" mso-bidi-font-family:\"times=\"\" roman\";color:#333333\"=\"\" style=\"font-size: 10pt;\"><span style=\"font-family: Nunito;\">How long does British Lingua retain/store user data?</span><o:p></o:p></span></p><span style=\"font-family: Nunito;\"></span><p class=\"MsoNormal\" style=\"margin-bottom: 8.3pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span lang=\"EN-US\" times=\"\" new=\"\" roman\";=\"\" mso-bidi-font-family:\"times=\"\" roman\";color:#333333\"=\"\" style=\"font-size: 10pt;\"><span style=\"font-family: Nunito;\">Currently, British Lingua retains user data while an account is active and for at least five years afterwards. It may alter this practice according to legal and business requirements. For example, it may lengthen or shorten the retention period.&nbsp;</span><o:p></o:p></span></p><span style=\"font-family: Nunito;\"></span><p class=\"MsoNormal\" style=\"margin: 8.3pt 0cm; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span lang=\"EN-US\" times=\"\" new=\"\" roman\";=\"\" mso-bidi-font-family:\"times=\"\" roman\";color:#333333\"=\"\" style=\"font-size: 10pt;\"><span style=\"font-family: Nunito;\">Log information</span><o:p></o:p></span></p><span style=\"font-family: Nunito;\"></span><p class=\"MsoNormal\" style=\"margin-bottom: 8.3pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span lang=\"EN-US\" times=\"\" new=\"\" roman\";=\"\" mso-bidi-font-family:\"times=\"\" roman\";color:#333333\"=\"\" style=\"font-size: 10pt;\"><span style=\"font-family: Nunito;\">When you access British Lingua\'s Website, its servers automatically record information that your browser sends whenever you visit a website. These server logs may include information such as your web request, internet protocol address, browser type, browser language, the date and time of your request and one or more cookies that may uniquely identify your browser.&nbsp;</span><o:p></o:p></span></p><span style=\"font-family: Nunito;\"></span><p class=\"MsoNormal\" style=\"margin: 8.3pt 0cm; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span lang=\"EN-US\" times=\"\" new=\"\" roman\";=\"\" mso-bidi-font-family:\"times=\"\" roman\";color:#333333\"=\"\" style=\"font-size: 10pt;\"><span style=\"font-family: Nunito;\">User communications</span><o:p></o:p></span></p><span style=\"font-family: Nunito;\"></span><p class=\"MsoNormal\" style=\"margin-bottom: 8.3pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span lang=\"EN-US\" times=\"\" new=\"\" roman\";=\"\" mso-bidi-font-family:\"times=\"\" roman\";color:#333333\"=\"\" style=\"font-size: 10pt;\"><span style=\"font-family: Nunito;\">When you send an email or other communication to British Lingua, it may retain those communications in order to process your inquiries, respond to your requests and improve our Services.</span><o:p></o:p></span></p><span style=\"font-family: Nunito;\"></span><p class=\"MsoNormal\" style=\"margin: 8.3pt 0cm; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span lang=\"EN-US\" times=\"\" new=\"\" roman\";=\"\" mso-bidi-font-family:\"times=\"\" roman\";color:#333333\"=\"\" style=\"font-size: 10pt;\"><span style=\"font-family: Nunito;\">Contact Information</span><o:p></o:p></span></p><span style=\"font-family: Nunito;\"></span><p style=\"margin: 0cm;\"><span lang=\"EN-US\" calibri\",sans-serif;mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:=\"\" minor-latin;mso-bidi-font-family:\"times=\"\" new=\"\" roman\";color:#1c1e29\"=\"\" style=\"font-size: 10pt;\"><span style=\"font-family: Nunito;\">British Lingua\'s Grievance Officer shall undertake all reasonable efforts to address your grievances at the earliest possible opportunity.&nbsp;</span><o:p></o:p></span></p><span style=\"font-family: Nunito;\"></span><p style=\"margin: 0cm;\"><span lang=\"EN-US\" calibri\",sans-serif;mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:=\"\" minor-latin;mso-bidi-font-family:\"times=\"\" new=\"\" roman\";color:#1c1e29\"=\"\" style=\"font-size: 