INSERT INTO `rating` (`id`, `rating`, `user_id`, `ratable_id`, `ratable_type`, `date_added`, `last_modified`, `review`) VALUES
(1, 5, 2, 1, 'course', 1718044200, NULL, 'I thank you, British Lingua, for improving my communication skills, including my personality development abilities, in such a short space of time. However, I found it difficult to improve my English earlier. It is British Lingua that proved me wrong in terms of my negative approach towards the English institute. I stand corrected.\r\n\r\nWhat I have been able to gain is that I can hold conversations in English with anyone fluently and confidently.  Further, I have developed a very high opinion about British Lingua that has enabled me to improve my interview skills, and I feel I will do better in competitive exams conducted by various government departments.\r\n\r\nI realise English is very important, irrespective of the fields you choose to have a career in. Hence, I endorse British Lingua.'),
(2, 5, 2, 5, 'course', 1718044200, NULL, 'I think British lingua is the best institute located at Laxmi Nagar, Delhi.\r\n\r\nHonestly speaking, when I came to  British       Lingua for the first time, my score was literally zero. However, I have been able to improve  drastically once I became  a part of it.\r\n\r\nI can say that my trainer Mr Ratan Jha is the best one.\r\n\r\nI really appreciate British Lingua and its team.'),
(3, 5, 2, 2, 'course', 1718303400, NULL, 'British Lingua is the best institute for English speaking and conversation and group discussion skills. At British Lingua, my best teacher is Dr.Birbal Jha. He is a good teacher and all students are equal his eyes . Every day he asks me what is my learning of the day? so I like this institute, and I am happy about speaking English here I recommend this institute.'),
(4, 5, 2, 11, 'course', 1718303400, NULL, 'Pretty good environment for spoken English improvement where even grammar is taken care of.\r\nThe availability of a team of trainers and mentors presents a great attraction.\r\nThe batches are inclusive of candidates from diverse sections (10th or 12th grade), graduates, postgraduates, and those working under the same roof.\r\nA great number of good books are also available.\r\nCooperative management is in place.\r\nAir-conditioned classrooms make the learning process convenient.'),
(5, 5, 2, 10, 'course', 1718303400, NULL, 'I think British lingua is the best institute located at Laxmi Nagar, Delhi.\r\n\r\nHonestly speaking, when I came to  British       Lingua for the first time, my score was literally zero. However, I have been able to improve  drastically once I became  a part of it.\r\n\r\nI can say that my trainer Mr Ratan Jha is the best one.\r\n\r\nI really appreciate British Lingua and its team.'),
(6, 5, 2, 3, 'course', 1718303400, NULL, 'Honestly speaking I have been able  to improve my English greatly. I stand motivated as the trainer asks us to work hard till the success is achieved .\r\nFurthermore  I find  all trainers good and competent .'),
(7, 5, 2, 4, 'course', 1718303400, NULL, 'I was not able to express myself in English earlier. Therefore, I joined British Lingua a few months ago. However, I started speaking English gradually once I became a part of this institution. I had several sessions with Miss Mehak Anand, who is a trainer for the elementary level course. '),
(8, 5, 2, 6, 'course', 1718303400, NULL, 'British Lingua is the best institute at Laxmi Nagar. It is located near Laxmi Nagar metro station. I find here a very good environment. The trainers are very good. When  I joined British lingua then I felt very nervous but after some time I feel very good. My trainer is Mr Ratan Jha who is very good.'),
(9, 5, 2, 8, 'course', 1718303400, NULL, 'Started my journey with British Lingua 4 months back, And today I got a job in a MNC on the basis of my good communication skills. The teachers are well qualified and very fun to learn with! I recommend BL for quality learning and result output. Thankyou BL'),
(10, 5, 2, 9, 'course', 1718303400, NULL, 'The faculties at the Institute is undoubtedly their biggest strength. The instructors are highly knowledgeable, professional, and passionate about teaching English. They have a unique way of making the lessons engaging and interactive, keeping the students actively involved in the learning process.'),
(11, 5, 2, 7, 'course', 1718303400, NULL, 'I highly recommend British Lingua to anyone seeking to improve their English language skills. Whether you are a beginner or looking to refine your existing abilities, this institute is the perfect place to achieve your language goals. I am grateful for the knowledge and confidence I gained during my time here.\r\n\r\nThank you, British Lingua for providing an enriching learning experience!');
